-- Table structure for comment
-- ----------------------------
DROP TABLE IF EXISTS `comment`;
CREATE TABLE `comment` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `sku_id` int(11) unsigned NOT NULL COMMENT 'ReferenceId as associate_id 商品id、类型+id(老数据)',
  `item_id` int(11) NOT NULL COMMENT '商品编号',
  `user_id` int(11) NOT NULL COMMENT 'Uid as user_id',
  `title` varchar(100) NOT NULL COMMENT 'Title as title',
  `content` varchar(3700) NOT NULL COMMENT 'Content as content',
  `score` tinyint(4) NOT NULL COMMENT 'Score as score5分：好评、3-4分：中评、1-2分：差评、其他评论默认是5分',
  `useless_count` int(11) DEFAULT NULL COMMENT 'UselessVoteCount as useless_count',
  `useful_count` int(11) DEFAULT NULL COMMENT 'UsefulVoteCount as useful_count',
  `advantage` varchar(700) DEFAULT NULL COMMENT 'Pros as advantage',
  `disadvantage` varchar(400) DEFAULT NULL COMMENT 'Cons as disadvantage',
  `order_id` int(11) DEFAULT NULL COMMENT 'OrderId as order_id(验证购买过的需要用到—评价,晒单等)',
  `topped` tinyint(4) DEFAULT NULL COMMENT 'isTop as topped（1置顶0未置顶-1沉低） bit as tinyint',
  `status` tinyint(4) DEFAULT '0' COMMENT 'Status as status(0：待审核 ，1：审核通过， 2：审核不通过)',
  `deleted` tinyint(4) DEFAULT '0' COMMENT 'IsDelete as dealt(0：不显示，1：显示)',
  `integral` smallint(6) DEFAULT NULL COMMENT 'remark as integral  需程序解析为积分数保存',
  `ip` varchar(15) DEFAULT NULL COMMENT 'UserIp as ip',
  `sort_number` int(11) DEFAULT NULL,
  `created` datetime DEFAULT NULL COMMENT 'CreationTime as created',
  `modified` datetime DEFAULT NULL COMMENT 'UpdateTime as modified',
  `item_name` varchar(100) DEFAULT NULL COMMENT '商品名称',
  `user_name` varchar(100) DEFAULT NULL COMMENT '用户名称',
  `category_id_1` int(11) unsigned DEFAULT NULL COMMENT '一级分类id',
  `category_name_1` varchar(100) DEFAULT NULL COMMENT '一级分类名称',
  `category_id_2` int(11) unsigned DEFAULT NULL COMMENT '二级分类id',
  `category_name_2` varchar(100) DEFAULT NULL COMMENT '二级分类名称',
  `category_id_3` int(11) unsigned DEFAULT NULL COMMENT '三级分类id',
  `category_name_3` varchar(100) DEFAULT NULL COMMENT '三级分类名称',
  `category_id_4` int(11) unsigned DEFAULT NULL COMMENT '四级分类id',
  `category_name_4` varchar(100) DEFAULT NULL COMMENT '四级分类名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

