  `service_tel` varchar(20) DEFAULT NULL COMMENT '服务电话',
  `service_image` varchar(100) DEFAULT NULL COMMENT '服务图片',
  `category_id` int(10) unsigned DEFAULT NULL COMMENT '所属分类ID',
  `sort_number` int(10) unsigned DEFAULT NULL COMMENT '排序号',
  `yn` tinyint(3) unsigned DEFAULT NULL COMMENT '有效性（0-无效 1有效）',
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `category_id1` int(10) unsigned DEFAULT NULL COMMENT '所属分类ID',
