-- ----------------------------
-- Table structure for sku
-- ----------------------------
DROP TABLE IF EXISTS `sku`;
CREATE TABLE `sku` (
  `sku_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'SKU_ID',
  `item_id` int(10) unsigned DEFAULT NULL COMMENT '商品ID',
  `sales_property` varchar(200) DEFAULT NULL COMMENT '销售属性',
  `sales_property_name` varchar(200) DEFAULT NULL COMMENT '销售属性名称',
  `least_buy` int(10) DEFAULT NULL COMMENT '起买量',
  `bar_code` varchar(50) DEFAULT NULL COMMENT '条形码',
  `cost_price` double(10,2) unsigned DEFAULT NULL COMMENT '成本价',
  `tb_price` double(10,2) unsigned DEFAULT NULL COMMENT '天宝价',
  `stock` int(10) unsigned DEFAULT NULL COMMENT '库存数量',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modified` datetime DEFAULT NULL COMMENT '修改时间',
  `yn` tinyint(3) unsigned DEFAULT NULL COMMENT '有效性（0 无效 1有效）',
  PRIMARY KEY (`sku_id`),
  UNIQUE KEY `Index_sku_Sales_property` (`item_id`,`sales_property`)
) ENGINE=InnoDB AUTO_INCREMENT=704 DEFAULT CHARSET=utf8;

