-- ----------------------------
-- Table structure for ump_info
-- ----------------------------
DROP TABLE IF EXISTS `ump_info`;
CREATE TABLE `ump_info` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT NULL,
  `user_id` int(20) DEFAULT NULL,
  `type` int(4) DEFAULT NULL COMMENT '类型，1为支付，2为支付完成（U付回调）',
  `trade_no` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT 'U付订单号',
  `param` varchar(10000) CHARACTER SET utf8 DEFAULT NULL COMMENT '参数列表',
  `amount` double DEFAULT NULL COMMENT '订单金额',
  `trade_state` varchar(40) CHARACTER SET utf8 DEFAULT NULL COMMENT '	 *  支付状态 \r\n	 *  WAIT_BUYER_PAY交易创建，等待买家付款     \r\n	 *  TRADE_SUCCESS交易成功，不能再次进行交易\r\n	 *  TRADE_CLOSED交易关闭 。指定时间段内未支付时关闭的交易；\r\n	 *  TRADE_CANCEL交易撤销\r\n	 *  TRADE_FAIL交易失败',
  `mer_date` datetime DEFAULT NULL COMMENT '生成支付信息时的日期',
  `pay_date` datetime DEFAULT NULL COMMENT '用户支付日期',
  `settle_date` datetime DEFAULT NULL COMMENT '对账日期',
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

-- ----------------------------
-- Records of ump_info
-- ----------------------------

