INSERT INTO `item_description` VALUES ('173', '117', '<span><span style=\"font-family:黑体;\"><span style=\"font-family:\'Microsoft YaHei\';line-height:2;\">牛油果</span><span style=\"font-family:\'Microsoft YaHei\';line-height:2;\">又称为酪梨、因为外形像梨，外皮粗糙又像鳄鱼头，因此人们也常称其为鳄梨或油梨，有一很大的果核，其果肉为黄绿色，味如牛油。</span></span><strong><span style=\"font-family:\'Microsoft YaHei\';line-height:2;\"></span></strong></span>', '<span><strong><span style=\"font-family:黑体;\"><span style=\"font-family:\'Microsoft YaHei\';line-height:2;\"></span></span></strong><span><span style=\"font-family:黑体;\"><span style=\"font-family:\'Microsoft YaHei\';line-height:2;\">牛油果</span><span style=\"font-family:\'Microsoft YaHei\';line-height:2;\">又称为酪梨、因为外形像梨，外皮粗糙又像鳄鱼头，因此人们也常称其为鳄梨或油梨，有一很大的果核，其果肉为黄绿色，味如牛油。</span></span></span><strong><span style=\"font-family:\'Microsoft YaHei\';line-height:2;\"></span></strong></span>', '2015-03-20 14:49:13', '2015-07-22 15:11:19');
