INSERT INTO `item_description` VALUES ('199', '143', '果型为特有的卵圆形，果品向阳面有斜角，果面色泽自然，果面底色为黄绿色，整个果面黄、绿、红色自然过渡，果面有隐约的果点，果品切开后，果肉泛轻微的淡黄；<div class=\"para\">果品有着独特、浓郁的香味，清香宜人，沁人心脾；</div><div class=\"para\">果面越擦越亮，有一层天然的蜡质，果面光照，没有任何的粗糙、刮手的感觉，这也是其他同类果品所不具备的；</div><div class=\"para\">肉质鲜嫩、香气浓郁、汁多味甜、酥脆爽口、酸甜适宜、皮薄无渣的独特口感。</div>', '果型为特有的卵圆形，果品向阳面有斜角，果面色泽自然，果面底色为黄绿色，整个果面黄、绿、红色自然过渡，果面有隐约的果点，果品切开后，果肉泛轻微的淡黄；<div class=\"para\">果品有着独特、浓郁的香味，清香宜人，沁人心脾；</div><div class=\"para\">果面越擦越亮，有一层天然的蜡质，果面光照，没有任何的粗糙、刮手的感觉，这也是其他同类果品所不具备的；</div><div class=\"para\">肉质鲜嫩、香气浓郁、汁多味甜、酥脆爽口、酸甜适宜、皮薄无渣的独特口感。</div>', '2015-03-20 16:49:10', '2015-03-20 17:05:28');
