INSERT INTO `item_description` VALUES ('364', '324', '<p><pre id=\"best-content-283869874\" class=\"best-text mb-10\">释迦又名番荔枝，外形因类似佛像头部而出名。释迦果肉乳白色，富含维生素A,B,C及蛋白质，铁，钙，磷等，促进消化。</pre><br /></p><p><br /></p>', '<pre id=\"best-content-283869874\" class=\"best-text mb-10\">释迦又名番荔枝，外形因类似佛像头部而出名。释迦果肉乳白色，富含维生素A,B,C及蛋白质，铁，钙，磷等，促进消化。<pre id=\"best-content-283869874\" class=\"best-text mb-10\">\r\n</pre><pre id=\"best-content-283869874\" class=\"best-text mb-10\">\r\n</pre><pre id=\"best-content-283869874\" class=\"best-text mb-10\">\r\n</pre></pre><br />', '2015-07-27 11:02:59', '2015-07-27 11:02:59');
INSERT INTO `item_description` VALUES ('365', '325', '<p>泰国进口椰青（9个/箱） 纯天然饮品，清甜的椰汁，滑嫩香浓的椰肉 ，夏日冰镇后味道更佳。</p><p><br /></p>', '<p>泰国进口椰青（9个/箱） 纯天然饮品，清甜的椰汁，滑嫩香浓的椰肉 ，夏日冰镇后味道更佳。</p>', '2015-07-27 11:14:06', '2015-07-27 11:14:06');
INSERT INTO `item_description` VALUES ('366', '326', '都乐青柚 每箱10头装 其营养价值很高，含有非常丰富的蛋白质、有机酸、维生素以及钙、磷、镁、钠等人体必需的元素，这是其他水果所难以比拟的。而且还具有健胃、润肺、补血、清肠、利便等功效，可促进伤口愈合。', '都乐青柚 每箱10头装 其营养价值很高，含有非常丰富的蛋白质、有机酸、维生素以及钙、磷、镁、钠等人体必需的元素，这是其他水果所难以比拟的。而且还具有健胃、润肺、补血、清肠、利便等功效，可促进伤口愈合。', '2015-07-30 16:02:17', '2015-07-31 10:51:44');
INSERT INTO `item_description` VALUES ('367', '327', '澳柑 皮薄柔软，色泽鲜艳，汁水充溢，酸甜适口，果肉细腻。其含有丰富的维生素C、维生素A、柠檬酸、氨基酸以及维生素A2、维生素B1、钙、磷、铁等营养成分，可缓解秋季皮肤干燥，是抗疲劳，生津止渴，增强身体抵抗力的最佳时令水果。同时也是孕期女性的天然营养剂。 ', '澳柑 皮薄柔软，色泽鲜艳，汁水充溢，酸甜适口，果肉细腻。其含有丰富的维生素C、维生素A、柠檬酸、氨基酸以及维生素A2、维生素B1、钙、磷、铁等营养成分，可缓解秋季皮肤干燥，是抗疲劳，生津止渴，增强身体抵抗力的最佳时令水果。同时也是孕期女性的天然营养剂。', '2015-07-31 15:47:04', '2015-07-31 15:47:04');
INSERT INTO `item_description` VALUES ('368', '328', '都乐凤梨 每箱7个装，不仅外形美观，而且口感非常好，无需盐水浸泡，可直接切开食用，好吃不上火。还有健胃消食，清热除烦，生津解渴，保护心血管的功效。<br />', '都乐凤梨 每箱7个装，不仅外形美观，而且口感非常好，无需盐水浸泡，可直接切开食用，好吃不上火。还有健胃消食，清热除烦，生津解渴，保护心血管的功效。', '2015-08-03 15:28:42', '2015-08-03 15:28:42');
INSERT INTO `item_description` VALUES ('369', '329', '甘蔗凤梨&nbsp; 因其果肉如甘蔗般的甜蜜而命名。低钠、低钾、低脂肪、零胆固醇，且含量丰富的维他命B1，是特别适合用来减肥的水果。它所独有的营养元素，菠萝酵素，是一种蛋白分解酵素，能帮助动物蛋白质的消化吸收，因此，在大鱼大肉大餐之后，食用凤梨是不错的选择。', '甘蔗凤梨&nbsp; 因其果肉如甘蔗般的甜蜜而命名。低钠、低钾、低脂肪、零胆固醇，且含量丰富的维他命B1，是特别适合用来减肥的水果。它所独有的营养元素，菠萝酵素，是一种蛋白分解酵素，能帮助动物蛋白质的消化吸收，因此，在大鱼大肉大餐之后，食用凤梨是不错的选择。', '2015-08-03 15:48:03', '2015-08-03 15:50:18');
INSERT INTO `item_description` VALUES ('370', '330', '牛奶凤梨是台湾最好吃的水果之一，以其白色果肉像牛奶一样白而得名，酸甜可口，果肉细腻。', '牛奶凤梨是台湾最好吃的水果之一，以其白色果肉像牛奶一样白而得名，酸甜可口，果肉细腻。', '2015-08-03 16:03:05', '2015-08-03 16:03:05');
